INSERT INTO `curiousWorkbench_contentlibrary` VALUES (0,'Launching A New Product','PopurlsBrown','https://i.ytimg.com/vi/VVMAswJf1dc/mqdefault.jpg','https://www.youtube.com/watch?v=VVMAswJf1dc','VVMAswJf1dc','External_Content','launch_new_products','','','',0,0,'','','',''),(1,'11 Essential Non-Technical Product Management Skills','Like a CEO, a PM must also master non-technical - but no less challenging - skills in order to ensure their product\'s (and company\'s) success.','non-technical-product-management-skills-1366x683-1.jpg','http://community.uservoice.com/blog/non-technical-product-management-skills/','','WebPage','Product_Market_Fit','Which one of these is not an essential product management skill','1:Business Acumen|2:Persuasion|3:General fitness','3',0,0,'','','','Button'),(2,'The Top 5 Technical Skills Every Product Manager Should Know','You are kind of the mini-CEO - with all of the responsibility?but without any of the authority','software-team-sport-climbing-800x518-768x497.jpg','http://community.uservoice.com/blog/technical-skills-every-product-manager-should-know/','','WebPage','Product_Market_Fit','Which of these is not an Technical Skill needed for Product Managers','1:DataAnalysis|2:Java|3:AB Testing','2',0,0,'','','','Button'),(3,'Managing Cross-Functional Teams','Cross-functional teams are significantly different from teams that are aligned on one functional level.  ','24_VR_1927889_Garry_2x1.jpg','https://www.mindtools.com/pages/article/newTMM_30.htm','','WebPage','Product_Market_Fit','Which of these is essential for Cross Functional Teams','1:Clear Communication|2:Direct Reporting|3:Same Geography','1',0,0,'','','','Button'),(4,'Minimize Your time to Product Market fit','Product market fit is a key ask for good product managers','car.png','http://andrewchen.co/ttpmf-time-to-product-market-fit/','','WebPage','Product_Market_Fit','Reducing TTPMF is essential for startup','1:Yes|2:No|3:I dont know','1',0,0,'','','','Button'),(5,'How To Use 10 Psychological Theories To Persuade People','Influence your audience without feeling sleazy about it with these tips on social media.','3030173-poster-p-1-3030173-work-smart-how-to-use-10-psychological-theories-to-persuade-people.jpg','https://www.fastcompany.com/3030173/work-smart/how-to-use-10-psychological-theories-to-persuade-people','','WebPage','Product_Market_Fit','Which of these is not a psychological theory of persuasion','1:Amplification hyp|2:Priming|3:Field Sales','1',0,0,'','','','Button'),(6,'Can Counter Experience Bias','Product management can seem like a solitary journey at times, as you are the only person 100% focused on the fate of a particular product or feature.','product-management-experience-bias-communication-750x400.jpg','https://community.uservoice.com/blog/product-managers-counter-experience-bias/','','WebPage','Product_Market_Fit','Which of these is a method to counter experience bias','1:Customer feedback|2:Anologies|3:Reading up','1',0,0,'','','','Button'),(7,'How to Onboard Junior Product Managers for Success','It would be easy to view these new product managers as a distraction from your own daily grind, or even as competition, but this short-sighted view doesn\'t do anyone any favors','onboarding-junior-product-manager-1.jpg','https://community.uservoice.com/blog/onboarding-junior-product-managers/','','WebPage','Product_Market_Fit','Which of these is a not method to onboard junior members','1:Customer Interaction|2:Theory|3:Take long walks','2',0,0,'','','','Button'),(9,'Building an Effective Team','Everyone brings unique talents and strengths to the table, no-one is playing politics or bickering, and there\'s just enough competitive spirit to bring out the best in everyone. ','onboarding-junior-product-manager-1.jpg','https://www.mindtools.com/pages/article/building-effective-teams.htm','','WebPage','Product_Market_Fit','To build an effective team you do not have to','1:Analyze and Plan|2:Get the right people|3:theorize','3',0,0,'','','','Button'),(11,'Alan Chiu: Nailing Product-Market Fit','Takeaways from the Stanford Graduate School of Business Entrepreneur Symposium 2015.','https://i.ytimg.com/vi/4hpP88Z16KM/hqdefault.jpg','https://www.youtube.com/watch?v=4hpP88Z16KM','4hpP88Z16KM','YouTube','Product_Market_Fit','Why focus on customer early on','1:Right Solution|2:Early sales|3:Marketing','3',0,0,'','','','Button'),(12,'Tools for Entrepreneurs: Finding Product Market Fit','Google for Entrepreneurs and General Assembly have partnered up to create Tools for Entrepreneurs, video classes for entrepreneurs to grow their skills and grow their businesses. ','https://i.ytimg.com/vi/c-ruOFVG078/hqdefault.jpg','https://www.youtube.com/watch?v=c-ruOFVG078','c-ruOFVG078','YouTube','Product_Market_Fit','Instagram found product market fit ','1:Early|2:Mid|3:Later','1',0,0,'','','','Button'),(13,'Dan Olsen, A Playbook for Achieving Product-Market Fit, LSC15','Everyone working on a new product is trying to achieve the same goal: product-market fit. Although product-market fit is one of the most important Lean Startup concepts, itâ€™s also the least well defined. DanÂ ','https://i.ytimg.com/vi/vMu85j3E6oI/hqdefault.jpg','https://www.youtube.com/watch?v=vMu85j3E6oI','vMu85j3E6oI','YouTube','Product_Market_Fit','In the pyramid model , which of these are not part of the process','1:Market|2:Hypothesize|3:Test','2',0,0,'','','','Button'),(14,'Ash Maurya - 10 Steps to Product / Market Fit - Pioneers Festival 2012','','https://i.ytimg.com/vi/Nhl5nzUNQCA/hqdefault.jpg','https://www.youtube.com/watch?v=Nhl5nzUNQCA','Nhl5nzUNQCA','YouTube','Product_Market_Fit','What percentage of companies drastically change original plan','1:One Third|2:Two Third |3:All','2',0,0,'','','','Button'),(15,'Marc Andreessen: Product Vs. Business','The Business Insider presents Innovation: a series of interviews with today\'s most innovative business leaders, sponsored by Mercedes-Benz. Marc Andreessen,','https://i.ytimg.com/vi/zfOsP3PmI1U/hqdefault.jpg','https://www.youtube.com/watch?v=zfOsP3PmI1U','zfOsP3PmI1U','YouTube','Product_Market_Fit','When do you know a product has achieve product market fit','1:Market asks for product|2:Marketing required |3:Not Sure','2',0,0,'','','','Button'),(16,'10 Steps to Product-Market Fit','Product/Market Fit is first significant milestone that matters. But while we know what Product/Market Fit should feel like, we don\'t quite know how to get there.Â ','https://i.ytimg.com/vi/1Ge_bb8JJ90/hqdefault.jpg','https://www.youtube.com/watch?v=1Ge_bb8JJ90','1Ge_bb8JJ90','YouTube','Product_Market_Fit','Start with a one page business plan','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(17,'Startup Workshop #1: Product-Market-Fit','The hunt for finding product/market fit in an early-stage startup is an elusive one, often fraught with chaos, and certainly never easy.','https://i.ytimg.com/vi/F9aG_8CwSMM/hqdefault.jpg','https://www.youtube.com/watch?v=F9aG_8CwSMM','F9aG_8CwSMM','YouTube','Product_Market_Fit','Product market fit is the holy grail of startups','1:Yes|2:No|3:Maybe','3',0,0,'','','','Button'),(19,'The Three Fatal traps between MVP and Product-Market Fit by Matt Clifford','Matt (@matthewclifford) is co-founder and CEO of Entrepreneur First, Europe\'s leading accelerator for technical founders.','https://i.ytimg.com/vi/19G99_sWApI/hqdefault.jpg','https://www.youtube.com/watch?v=19G99_sWApI','19G99_sWApI','YouTube','Product_Market_Fit','Premature scaling is good','1:Yes|2:No|3:Maybe','2',0,0,'','','','Button'),(21,'Startup Workshop #1: Product-Market-Fit','What is Product/Market Fit? Why is it the Holy Grail of entrepreneurship?','https://i.ytimg.com/vi/F9aG_8CwSMM/hqdefault.jpg','https://www.youtube.com/watch?v=F9aG_8CwSMM','F9aG_8CwSMM','YouTube','Product_Market_Fit','Product market fit is the right product at the right ime','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(22,'How to Get to Product/Market Fit - by CÃ´me Courteault, Growth Hacker at TheFamily','','ht