read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(69,'Cross-Functional teams','','https://i.ytimg.com/vi/B-1pzaKzYjA/hqdefault.jpg','https://www.youtube.com/watch?v=B-1pzaKzYjA','B-1pzaKzYjA','YouTube','Cross_Functional_Teams','Did you read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(70,'Best Practice in Creating Cross-Functional Teams\n','','https://i.ytimg.com/vi/iq3v3fxjHXI/hqdefault.jpg','https://www.youtube.com/watch?v=iq3v3fxjHXI','iq3v3fxjHXI','YouTube','Cross_Functional_Teams','Did you read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(71,'Category Management The Cross Functional Team ','','https://i.ytimg.com/vi/MipsEiKssl4/hqdefault.jpg','https://www.youtube.com/watch?v=MipsEiKssl4','MipsEiKssl4','YouTube','Cross_Functional_Teams','Did you read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(72,'How To Write A Project Specification','','https://i.ytimg.com/vi/MCXi4KtRTG0/hqdefault.jpg','https://www.youtube.com/watch?v=MCXi4KtRTG0','MCXi4KtRTG0','YouTube','Cross_Functional_Teams','Did you read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(73,'Importance of Design Specifications','','https://i.ytimg.com/vi/eOckdCUOrQA/hqdefault.jpg','https://www.youtube.com/watch?v=eOckdCUOrQA','eOckdCUOrQA','YouTube','Product_Specification','Did you read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(74,'Sana Commerce - Product specifications','','https://i.ytimg.com/vi/OjRwkszJsoo/hqdefault.jpg','https://www.youtube.com/watch?v=OjRwkszJsoo','OjRwkszJsoo','YouTube','Product_Specification','Did you read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(75,'Product Specifications & Quality Control Checks','','https://i.ytimg.com/vi/LoZ8zMxHPIU/hqdefault.jpg','https://www.youtube.com/watch?v=LoZ8zMxHPIU','LoZ8zMxHPIU','YouTube','Product_Specification','Did you read this content','1:Yes|2:No|3:Maybe','1',0,0,'','','','Button'),(76,'','Content','Image','','','','','','','',1,1,'','Lets discover Product Market  Fit','','Text'),(77,'','','','','','','','Do  you think you have a problem?','1:Yes|2:No','1',2,1,'So, You don\'t have a Product Market Fit','Let\'s begin with Why ? Say you have a product to offer. You spend a lot of effort in getting people to use your product. Your product isn\'t taking off.  You have to constantly spend effort in promotions. Something does not feel right .\r\n\r\n\r\n\r\n\r\n','Hmm, Dont you think there is a problem if you need to keep pushing your product. You will eventually run out of steam and marketing dollars. Rigjt?','Text'),(79,'','','','','','','','Does that feel like an ideal situation?','1:Yes|2:No','1',3,1,'Awesome, Thats whats its like to have a product market fit. Dosent it feel  awesome? Lets see  how you can get there','Let us look at an ideal situation. You created a product. Customers find a real need  for it and start using your product. They may even refer others  to your product.  You see your effort in getting people to use your product is getting lower with time. \r\n\r\n','','Text'),(81,'','','','','','','','','','',4,1,'','Here is a definition \r\nProduct/market fit means being in a good market with a product that can satisfy that market. The term was coined by Mark Anderson a popular Venture Capitalist. Remember \"A good market\"  with \"A product that satisfies that market\".\r\n','','Text'),(82,'','','','','','','','','','',5,1,'','Another definition is creating a \"minimum viable product\" that addresses and solves a problem or need that exists.\r\n\r\n\r\n\r\n','','Text'),(83,'','','','','','','','Pick and option below','1:A |2:B |3: C','2',6,1,'1','let us try some examples. You know you haven\'t reached product market fit when. A:Users crave your product, B: Product doesn\'t sell itself, C: Not much marketing needed\r\n\r\n\r\n\r\n','1','Text'),(86,'','','','','','','','','1: Customers are clear about what need your product solves|2:Customers donâ€™t come back to use your product, customer donâ€™t talk about your  product|3: you feel like the usage slows as soon as you stop pushing your ware\n','Awesome',7,1,'Try Again','One More','','Text'),(87,'','','','','','','','','','',8,1,'','A problem/solution fit is a desire of customers for a solution to a problem. This has nothing to do with your company\'s product. A product Market fit is specific to your product addressing that need and being a solution of choice\r\n','','Text'),(88,'','','','','','','','','','',9,1,'','How do you go about finding a product market fit? ','','Text'),(89,'','','','','','','','','','',10,1,'','According to Alan Chiu at Standford School of Business, you may not be able to control Timing, But you can control the product and its target market\r\n','','Text'),(90,'','','','','','','','','','',11,1,'','You can control how you define your product, what goes in and what is left out. ','','Text'),(91,'','','','','','','','','','',12,1,'','You can also control your target market, Who you want to sell your product to. ','','Text'),(92,'','','','','','','','','','',13,1,'','Speak with lots of customers , understand their world and discover what your market should be.  May be you will find a different pain point.','','Text'),(93,'','','','','','','','','','',14,1,'','Here are 4 aspects that you can tweak for your product market fit. Again from Alan','','Text'),(94,'','','','','','','','Pick an option below','1:A|2:B|3:C','2',15,1,'','Tweak 1 : User: What is the job your user is trying to do and what interface will help your user achieve their goal. Which of the does not help with understanding User \r\nA. Process workflow \r\nB. Budget\r\nC. Current process','','Text'),(95,'','','','','','','','Pick an option','1:A|2:B|3:C','3',16,1,'','Tweak 2 : Application: How does your product interface with other products. So your product becomes part of the user\'s daily habit.  Pick one of these will not help\r\nA. Data flow\r\nB. Integrating apps\r\nC. Budget cycle\r\n\r\n\r\n','','Text'),(96,'','','','','','','','','','',17,1,'','Tweak 3: Data : What is the minimum about of data you need to deliver value to the user. And how you can deliver data to the user so they can  be successful in achieving their goal with that data\r\n','','Text'),(97,'','','','','','','','Pick one of the options','1:A|2:B|3:C','3',18,1,'','Tweak 4: Buyer: Understand the buyers purchasing decisions. Without knowing this you cannot optimize the product to make it easy for the buyer to buy. Pick one that does not help you understand Buyer \r\nA.) Buying process \r\nB.) Budget source \r\nC.) Feature Usage','','Text'),(98,'','','','','','','','','','',19,1,'','That\'s it, we have covered the basics of Product Market Fit. Over the next few weeks we will try more examples to understand product market fit even more.\r\n\r\n','','Text'),(99,'','','','','','','','','','',0,0,'','','','Text'),(100,'','','','','','','','','','',1,2,'','Lets discover Cross Functional Team Leadership','','Text'),(101,'','','','','','','','','','',2,2,'','It is the ability to effectively work with several teams responsible for different functions and achieve an expected result.\r\n','','Text'),(102,'','','','','','','','','','',3,2,'','So whats the big deal? Most cross-functional teams do not have a direct reporting structure , this means that you are working with teams that don\'t necessarily report to you, but you are responsible for the out come. Sounds fun:-)\r\n\r\n','','Text'),(103,'','','','','','','','Which of this is not a key aspect','1:Define roles|2:Direct Reports|3:Clean Communication','2',4,2,'','Let us explore what you can do to become effective at leading a cross functional team\r\nKey Aspects\r\n1.)  Build your team \r\n2.) Define Responsibilities \r\n3.) Agree on Milestones\r\n4.) Define a communication model \r\n5.) Define a feedback model\r\n\r\n\r\n\r\n','','Text'),(104,'','','','','','','','','','',5,2,'','You are  building a cross-functional team with resources from different functions, Identify the goal and work with the key resources to define what you need to achieve that goal. Then speak with peers to find out which resources can best meet your need\r\n','','Text'),(107,'','','','','','','','','','',1,3,'','Say you are working on a product. You are tasked with bringing together your thought\'s on the product and communicating it to your team . ','','Text'),(108,'','','','','','','','A lean canvas helps you think about the key aspects of your product and business','1:yes|2:no','1',2,3,'Thats right','How about we write a detailed business plan, or make a presentation? But ... No one reads those right ! On the other hand, a Lean canvas brings together the key aspects of a business plan on 1 page and helps you capture and communicate with clarity.\r\n','Ops try again','Text'),(109,'','','','','','','','','','',3,3,'','Further , when you are working with other people, you want everyone to be on the same page. ','','Text'),(110,'','','','','','','','Pick your choice','1:A|2:B|3:C','1',4,3,'','A 1-page lean canvas is better than a full business plan because. \r\nA.) People actually read it \r\nB.) Less work \r\nC.) Less paper\r\n\r\n','','Text'),(111,'','','','','','','','','','',5,3,'','Further , by forcing yourself to be brief, you will actually ensure you have thought about the different aspects of the product with clarity\r\n','','Text'),(112,'','','','','','','','','','',9,3,'','This is what a business canvas does. It brings  together key aspects of your product approach on a single page.  \r\n','','Text'),(113,'','','','','','','','','','',6,3,'','Here is an example of a Business Canvas , take a look','','Text'),(114,'','','https://upload.wikimedia.org/wikipedia/commons/1/10/Business_Model_Canvas.png','','','','','','','',10,3,'','Let\'s try this, Start working on your product canvas today\r\n\r\n','','Text'),(115,'','','https://milanpevec.files.wordpress.com/2013/06/lean-canvas_blank.png','','','','','','','',7,3,'','\r\n','','Image'),(116,'','','','','','','','Which is not part of lean canvas','1:Public Relations|2: Problem|3:Solution','1',8,3,'','Components of a Lean Canvas \r\nProblem \r\nSolution \r\nKey Metrics \r\nUSP  \r\nUnfair Advantage \r\nChannels  \r\nCustomer Segments \r\nCost Structure  \r\nRevenue Streams\r\n\r\n\r\n','','Text'),(117,'','','','','','','','','','',6,2,'','Roles: It is critical to define responsibilities and expectations. \r\nTry to have an open tracker that you can use in group meeting where all teams can see their expectations\r\n\r\n','','Text'),(118,'','','','','','','','','','',7,2,'','Milestones: All agreed upon items go on the tracker with owners, dead-lines and dependencies. When a milestone is define and communicated you increase your chances of a well performing Cross Functional Team\r\n','','Text'),(119,'','','','','','','','','','',8,2,'','Communication:  A communication model can be in the form of a weekly review on a single open tracker\r\n','','Text'),(120,'','','','','','','','','','',9,2,'','Feedback : Define a feedback method and a periodic feedback review process. Also encourage giving and receiving feedback \r\n','','Text'),(121,'','','','','','','','','','',10,2,'','That it, Lets try these concepts with your cross functional team','','Text');
