INSERT INTO `curiousWorkbench_messagelibrary` VALUES ('msg_WelcomeMessage_1','1','Text','Hi there, I am Walnut, I find skills you should have based on your role , location, industry etc . ','','','','',1),('msg_WelcomeMessage_2','1','Text','Then I help you acquire those skills, by just chatting with me. Doesn\'t that sound fun :-) . you also get to track and share your new skills with others.','http://www.walnutai.com/static/curiousWorkbench/images/walnuty.png','','','',2),('msg_WelcomeMessage_3','1','Buttons','Lets get started','http://www.walnutai.com/static/curiousWorkbench/images/walnuty.png','','ok:GET_USER_LOCATION:P','',3),('msg_askUserLocation','1','Text','Your location helps me find skills, that companies near you are looking for. Give me a Zip code . Eg: 94404','','','','',4),('msg_ackUserLocation','1','Text','Thats [[actionGetLocationFromPin]]','','','','',5),('msg_askUserRole','1','Text','Tell me your role at work. I currently support the following roles.','','','','text:Product Manager:ROLE_PRODUCT_MANAGER',6),('msg_askUserCompany','1','Text','And where do you work at ? Eg: Google Inc ','','','','',7),('msg_ackUserInfo','1','Text','Awesome, Thats good for now.','','','','',8),('msg_analyzeSkillInfo','1','Text','Ok, I analyzed 300 jobs postings in a 30 mile radius from your Zip code. Do you want to see what I dug up ?','','','','text:lets see them:ROLE_DEMAND_INFO',9),('msg_roleDemandInfo','1','Text','[[actionGetRoleDemandInfo]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Lets Self Eval:SELF_EVAL_SKILLS:P, More:SHOW_OPTIONS:P','',10),('msg_askSelfEvalSkills','1','Buttons','Rate your self on â€œProduct market fitâ€','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','I use it every day:RECORD_SKILL_EVAL:P,I am aware:RECORD_SKILL_EVAL:P,not sure:RECORD_SKILL_EVAL:P','',11),('msg_ackSkillInfo','1','Text','Got It! ','','','','',12),('msg_showOptions','1','Buttons','What would you like to do today','http://www.walnutai.com/static/curiousWorkbench/images/walnuty.png','','Learn something new:ROLE_DEMAND_INFO:P, check progress:CHECK_PROGRESS:P','',13),('msg_ShowReco','1','Buttons','[[actionGetReco]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Learn something new:SHOW_RECO:P, my skills :ROLE_DEMAND_INFO:P, check progress:CHECK_PROGRESS:P','',14),('msg_SearchEventsAsk','1','Text','Enter a topic to search','','','','',15),('msg_ShowRecoSingle','1','Buttons','[[actionGetSingleReco]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Next:SHOW_RECO:P, More:WELCOME_INIT_1:P,share::S','',16),('msg_SearchContent','1','Buttons','[[actionGetSearch]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','Next:SHOW_RECO:P, More:SHOW_OPTIONS:P,share::S','',17),('msg_recordEvalSkill','1','Text','Ok , I have made a note, Lets work on that','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','','',18),('msg_checkProgress','1','Text','[[actionGetUserProgress]]','','','','',19),('msg_introduction','1','Buttons','Lets get started','http://www.walnutai.com/static/curiousWorkbench/images/walnuty.png','','ok:WELCOME_INIT_1:P','',20),('msg_introduce_2','1','Text','na','','','','',21),('msg_restart','1','Text','ok, Let start all over again','','','','',22),('msg_showQuestions','1','Buttons','[[actionAskQuestion]]','http://www.walnutai.com/static/curiousWorkbench/images/non-technical-product-management-skills-1366x683-1.jpg','','','',23),('msg_reviewAnswerToQuestion','1','Text','[[actionReviewAnswer]]','','','','',24),('msg_showModule','1','Buttons','[[actionGetModule]]','','','','',25),('msg_startModule','1','Text','[[actionStartModule]]','','','','',26),('msg_nextModuleContent','1','Text','[[actionNextModuleContent]]','','','','',27),('msg_oops','1','Text','oops!!','','','','',28),('msg_analyzeSkillInfoImage','1','Image','NA','http://www.walnutai.com/static/curiousWorkbench/images/skillAnalysis.png','','','',29),('msg_AboutMe','1','Text','I am Walnut ai , I keep an eye out on skills the market is looking for. And then I help you aquire those skills in a few conversations with me. Isnt that awesome','','','','text:what can you do:USER_ACTIONS',30),('msg_showUserActions','1','Text','Here are a few things you can do , To see relevant skills say :  \"Show skills\" To check out available module say :\" Show Modules\"','','','','',31),('msg_funnyMessage','1','Image','','https://s-media-cache-ak0.pinimg.com/564x/ff/db/78/ffdb783d33d132470318966dc1ba5ec5.jpg','','','',32),('msgConfirmTopicCreation','1','text','Do you want to create a new topic','','','','text:yes:CREATE_TOPIC',33),('msgAskTopicTitle','1','Text','Provide me a title for this topic. Eg: \"Product Market Fit\" or \"How to close open tickets\"','','','','',34),('msgConfirmTitle','1','Text','Got it, You can always change the title, by saying Change Title','','','','text:Add Content:ADD_CONTENT_FIRST',35),('msgAskContentFirst','1','Text','Ok, lets start. Go ahead and say what you would like about this topic.','','','','',36),('msgAddContent','1','Text','Ok, Say more to continue','','','','',37),('msgEnfContent','1','Text','Great we are done. You would like to test it','','','','',38);
