INSERT INTO `curiousWorkbench_module` VALUES (1,'Essentials of Product Market Fit','Marc Anderson coined the word PMF, which is now a popular measure for high growth products. ','Know what is PMF and how to use it in action','Chandan Maruthi','','http://leanstartup.co/wp-content/uploads/2015/11/Product-Market-Fit-Pyramid.png',20,20,20,'',0,0,NULL,'Product_Market_Fit'),(2,'Cross Functional Team Leadership','Product Managers have to work across divisions to achieve their goal. Do you have what it takes?','How can you be an effective CFT leader','James Anderson ','','http://2firkl1qsbue2ashgy21ze4i.wpengine.netdna-cdn.com/wp-content/uploads/2015/11/6-Essential-Traits-Your-Future-Leaders-Must-Have-to-Be-Successful-640x3021.png',10,5,10,'',0,0,NULL,'Cross_Functional_Leadership'),(3,'Lean Canvas','Nobody reads business plans, How do you get your teams to be on the same page','Learn how to put a Lean Canvas in place','James Anderson','','http://3daystartup.org/wp-content/uploads/2014/04/lean-canvas.jpg',10,5,10,'',0,0,NULL,'Go_To_Market');
